import styled from 'styled-components';

export const HeaderWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-top: 30px;

  .weatherItems {
    display: flex;
    align-items: flex-end;
  }

  h1 {
    margin-left: 20px;
    color: #0079f9;
  }

  img {
    width: 70px;
  }
`;
